  06> WILLIAMS, Violet Isabel m on 25.02.1913 to BIRCH, Cyril William
  b 17.09.1885 d 09.11.1968
  b 24.07.1880 d 26.01.1974
  Violet b. at Dunedin. Cyril b, at Folkstone, Kent, England and came to New Zealand at age
  19. He served in WW1 (1916-19) as a Captain in the Infantry then for a year with the Army of
  Occupation in Germany. Returning to New Zealand, he joined the head office of the National
  Insurance Company in Dunedin where he became General Manager in 1938 and a Director in 1948.
  He retired in 1954 but remained a member of the Board.
  Violet was, for many years, actively involved with St Matthew's Anglican Church in Dunedin.
  01> BIRCH, Mary Rowena (Molly) m on 01.06.1940 to HERRICK, Dennis Trevelyan
  b 16.05.1914
  b 06.10.1912 d 30.06.1941
  Molly b. at Dunedin and m. at St Matthew's Church, Dunedin. Dennis, s/o EJ Herrick and E Smith, bd. at
  Lorient, France. Address: 69 Beachville Road, Christchurch 8.
  Dennis was a farmer near Otane. He was awarded the George Medal for bravery in rescuing the pilot of an
  Oxford aircraft which crashed at Taieri in 1940. The plane was carrying a 25016 bomb.
  01> HERRICK, Dennis Anthony m on 10.11.1965 to (1)USSHER, Robin Frances
  b 18.05.1941
  b 11.12.1943
  Divorced 1981. Robin, d/o G A Ussher and Ella Bath of Timaru.
  01> HERRICK, Katherine Mary
  b 29.07.1967
  Katherine b. at Timaru.
  02> HERRICK, Gabrielle Frances
  b 01.01.1969
  Gabrielle b. at Timaru.
  03> HERRICK, David Edward
  b 14.09.1971
  David b. at Timaru. He graduated Master of Resource Management from Lincoln University in 1997
  and is now working for the Canterbury Regional Council.
  01> HERRICK, Dennis Anthony m on 28.03.1987 to (2) BEALE, Barbara Lillian
  b 18.05.1941
  b 23.08.1943
  Dennis b. at Dunedin and m. at Christchurch. Barbara, d/o E Legg and Eva Prattley. Address: 4
  Cephas Close, Upper Riccarton, Christchurch 4.
  Dennis was born profoundly deaf. He is a technician in the Animal Science Department at Lincoln
  University.
